import React from "react";

export function Device() {
  return (
    <form>
      <div className="form-group row">
        <label for="device" className="col-sm-2 col-form-label">
          Device Type
        </label>
        <div className="col-sm-10">
          <input
            type="text"
            class="form-control"
            id="deviceType"
            placeholder="Device"
          />
        </div>
      </div>
    </form>
  );
}
